package nosql.telemedicine.pucit.test;

import java.io.File;
import java.io.FileOutputStream;
import java.text.DateFormat;
import java.text.SimpleDateFormat;
import java.util.Date;

import org.apache.commons.codec.binary.Base64;

import sun.misc.BASE64Decoder;

public class Base64DecodeTester 
{
	public static void main(String[] args) throws Exception
	{
		String base64Data = "";
	
		// Getting time of invocation
		DateFormat dateFormat = new SimpleDateFormat("yyyyMMddHHmmss");
		   //get current date time with Date()
		Date date = new Date();
		String imageName = dateFormat.format(date);
		
		    
		 // Converting a Base64 String into Image byte array 
		byte[] imageByteArray = Base64.decodeBase64(base64Data);
		
		
		 // Write a image byte array into file system  
		FileOutputStream imageOutFile = new FileOutputStream(new File("c:\\temp\\"+imageName+".jpg"));
		imageOutFile.write(imageByteArray);
		imageOutFile.close();
		
		
		
		System.out.println("Image Successfully Manipulated!");

		//END OF BASE64 TO IMAGE WRITE

	}
	public static byte[] decodeImage(String imageDataString) {		
		return Base64.decodeBase64(imageDataString);
	}
}
